import React from "react";

function ResultTable(props){

    return(
        <table className="result">
            <thead>
                <tr>
                    <th>Year</th>
                    <th>Total Savings</th>
                    <th>Interest (Year)</th>
                    <th>Total Interest</th>
                    <th>Invested Capital</th>
                </tr>
            </thead>
            <tbody>
                {
                    props.data.map(function(event){
                        return(
                            <tr key={event.year}>
                                <td>{event.year}</td>
                                <td>{event.savingsEndOfYear}</td>
                                <td>{event.yearlyInterest}</td>
                                <td>{event.savingsEndOfYear - props.initialInvestment - event.yearlyContribution * event.year}</td>
                                <td>{props.initialInvestment + event.yearlyContribution * event.year}</td>
                            </tr>
                        )
                    })
                }
            </tbody>
        </table>
    )
};

export default ResultTable;
